dunes-script-module.script:
var resourceElementCategory = Server.getResourceElementCategoryWithPath("PSCoE/Library/GuestUserDomainOperations");
var resElements = resourceElementCategory.resourceElements;
var resElementNames = new Array();

for each(var resElem in resElements) {
	//Collect resource element name
	resElementNames.push(resElem.name);
}

return resElementNames;
